  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Ouray National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1962.
  The report begins by summarizing the weather conditions and habitat conditions during
  this period. Wildlife including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, mammals, and raptors is also covered. The Refuge
  development and maintenance section discusses physical developments. Resource management
  is outlined; topics include grazing and haying. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes Refuge visitors, Refuge participation, and safety. Items of interest and
  NR forms are attached\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
